define(function(){
    /**
     * Clamps value inside range.
     */
    /**
     * Description
     * @method clamp
     * @param {} val
     * @param {} min
     * @param {} max
     * @return ConditionalExpression
     */
    function clamp(val, min, max){
        return val < min? min : (val > max? max : val);
    }
    return clamp;
});
